var C = {
    LOGO : {
        SPAN_SPAWN : 3000,
        WIDTH : 128,
        HEIGHT : 128,
        SRC : 'data:image/png;base64,'
    }
};

// XXX
var spawn_count = 0;
var max_spawn = 20;

chrome.storage.local.get('bunbun', function(result){
    if( result.bunbun.move_enabled == 1 ) {
        max_spawn = result.bunbun.max_spawn ? result.bunbun.max_spawn : max_spawn;
        logoManager();
    }
});


function logoManager() {
    var image = createImage();
    image.animationLoop();

    spawn_count += 1;
    if( spawn_count >= max_spawn ) {
        return;
    }

    setTimeout(function(){
        logoManager()
    }, C.LOGO.SPAN_SPAWN);
}

function createImage() {
    var image = document.createElement("img");
    image.src = C.LOGO.SRC;
    document.body.appendChild(image);
    image.width = C.LOGO.WIDTH;
    image.height = C.LOGO.HEIGHT;
    image.style.position = "fixed";
    //image.style.webkitTransform="scale(0.3, 0.3)";
    image.style.left = Math.random() * ( document.documentElement.clientWidth - C.LOGO.WIDTH ) + "px";
    image.style.top = Math.random() * ( document.documentElement.clientHeight - C.LOGO.HEIGHT ) + "px";
    image.style.zIndex = 0;

    image.vx = Math.random() * 10 - 5;
    image.vy = Math.random() * 10 - 5;
    image.move = function() {
        var left = Number( image.style.left.replace("px","") ) + image.vx;
        var top = Number( image.style.top.replace("px","") ) + image.vy;
        image.style.left = left + "px";
        image.style.top = top + "px";

        image.updateVector();
    },
    image.animationLoop = function(){
        image.move();
        requestAnimationFrame(image.animationLoop);
    },
    image.updateVector = function() {
        var x = Number( image.style.left.replace("px","") ) + image.width / 2;
        var y = Number( image.style.top.replace("px","") ) + image.height / 2;
        if( x < 0 || x > document.documentElement.clientWidth ) {
            image.vx = -image.vx;
        }
        else if( y < 0 || y > document.documentElement.clientHeight ) {
            image.vy = -image.vy;
        }
    }
    return image;
}

